7,536871039]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^Ulogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1272,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66816c5f-d206-4d9c-97ac-4b84eefb312flogseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^Flogseq____&quot;,1272,536871039]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^Xlogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^Vlogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^Ulogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1273,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66816c5f-b15e-4f41-9075-5242e7833c7alogseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1274,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&gt; 高楼金总共有16栋楼，其中1号楼到7号楼住的是回迁村民，8号楼到16号楼是外来的租客。回迁楼的快件都很好送，他们是本地人，白天有老人在家，即便碰到外出买菜，快件也可以放在门边或水电井里。因为村民们彼此熟识，邻里间会互相关照，连贴小广告的都不敢上去，怕被楼里的老人逮住。相对地，租客住的几栋楼就鱼龙混杂，他们大多是北漂的年轻人，有的还是合租户，白天都去上班后，屋里就没有人了。住户之间彼此不认识，楼里进出的陌生人也多，快件很容易丢失。我刚到高楼金的时候，同组的一个同事就让我送8号楼到16号楼，他自己送1号楼到7号楼。于是我每天送半个高楼金、一个新城乐居，加影视城工地，三个分开的地方来回跑，经常疲于奔命、气急败坏。\\n渐渐地，我在工作中陷入一种负面情绪里。我发现小区有的好送有的不好送，谁送了好送的别人就得送不好送的，同事之间就像零和博弈——要不就你好，要不就我好，但不能大家都好。刚来的时候，谁都是从最烂的小区送起，有的人因此走了，有的人没走。没走的人可能会换到好一点儿的小区，最后得到好送的小区的人会长久留下来，剩下不好送的小区就让新人去送。新人刚来时一般都不会太计较，但逐渐地就会察觉到其中的不公平。这种心态的转变一般只需要一两个月，甚至更短。假如迟迟没有改变的机会，新人就会离开。于是小组里总有一半的人雷打不动，另一半的人却换个不停。\\n我不想和搭档闹翻，不想难看地和他争执、讨价还价。但我也不喜欢和占我便宜的人共事。假如我每天下班比别人晚、挣钱比别人少，我就会烦躁和不满，然后变得不太在乎这份工作了。就像深海里的鱼都是瞎子、沙漠里的动物都很耐渴一样，我是一个怎样的人，很大程度上是由我所处的环境，而不是由我的所谓本性决定的。其实在当时我就已经察觉到，工作中的处境正在一点点地改变我，令我变得更急躁、易怒，更没有责任心，总之做不到原本我对自己的要求，而且也不想做到了。这些改变有时会让我觉得痛快，我痛快的时候就不太能感觉到烦躁和不满。比如有次我骂了一个不认识的妇女——我很少骂人，因此印象特别深刻。logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1274,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1274,logseq____&quot;^Flogseq____&quot;,1273,536871039]],[logseq____&quot;^15logseq____&quot;,[1274,logseq____&quot;^Xlogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1274,logseq____&quot;^Vlogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1274,logseq____&quot;^Ulogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1274,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66816c5f-fc45-4068-b8a9-cbd3dfbb3899logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1275,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1275,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1275,logseq____&quot;^Flogseq____&quot;,1274,536871039]],[logseq____&quot;^15logseq____&quot;,[1275,logseq____&quot;^Xlogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1275,logseq____&quot;^Vlogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1275,logseq____&quot;^Ulogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1275,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66816c5f-f4b3-4120-9f8b-3e530d0e18c7logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1276,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1276,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871039]],[logseq____&quot;^15logseq____&quot;,[1276,logseq____&quot;^Flogseq____&quot;,1275,536871039]],[logseq____&quot;^15logseq____&quot;,[1276,logseq____&quot;^Xlogseq____&quot;,1097,536871039]],[logseq____&quot;^15logseq____&quot;,[1276,logseq__       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
